import React from "react";
import axios from "axios";
import DataTable from "react-data-table-component";
import logo from "./logo.svg";
import "./App.css";

class App extends React.Component {
  state = {
    employeeList: [],
  };

  componentDidMount() {
    this.searchEmployee();
  }

  searchEmployee() {
    // Make a request for a user with a given ID
    axios
      .get("https://randomuser.me/api/?results=20")
      .then((response) => {
        // this.setState({ employeeList: list });
        // handle success
        console.log(response);
        var i;

        var list = [];

        for (i = 0; i < response.data.results.length; i++) {
          console.log(response.data.results[i].name.first);

          list.push({
            name:
              response.data.results[1].name.title +
              " " +
              response.data.results[1].name.first +
              " " +
              response.data.results[1].name.last,
            email: response.data.results[1].email,
            gender: response.data.results[1].gender,
            cell: response.data.results[1].cell,
          });
        }
        this.setState({employeeList: list});

        console.log(response);
      })
      .catch((error) => {
        // handle error
        console.log(error);
      });
  }

  render() {
    return (
      <div>
        {/* {this.state.employeeList.map((employee, index)=>{
        return (
          <h1 key={index}>

            {employee.name.first}
            </h1>
        )
      })} */}
        <DataTable
          title="Arnold Movies"
          columns={this.state.employeeList}
          // customStyles={customStyles}
        />
      </div>
    );
  }
}

export default App;
